import React, { Component } from 'react';
import Phaser from 'phaser';
import phaserReact from "phaser3-react";
import { render } from 'react-dom';
import { gameConfig } from './Utilities/gameState';
// import TestScene from './Scenes/TestScene';

class Main extends Component {
    componentDidMount(){
        new Phaser.Game(gameConfig(Phaser, phaserReact));
    }

    shouldComponentUpdate(){
        return false;
    }

    render(){
        return (
            <div className="row">
                <div className="col-md-6 col-md-offset-3" id="gameConfig" />
            </div>

        )
    }
}

export default Main
